    <td><![endif]>
    <div>
    <p class=MsoNormal><span style='font-size:28.0pt;mso-bidi-font-size:11.0pt;
    line-height:105%'>América&nbsp;es el segundo&nbsp;<a
    href="https://es.wikipedia.org/wiki/Continente" title=Continente><span
    style='color:windowtext;text-decoration:none;text-underline:none'>continente</span></a>&nbsp;más
    grande de la&nbsp;<a href="https://es.wikipedia.org/wiki/Tierra"
    title=Tierra><span style='color:windowtext;text-decoration:none;text-underline:
    none'>Tierra</span></a>, después de&nbsp;<a
    href="https://es.wikipedia.org/wiki/Asia" title=Asia><span
    style='color:windowtext;text-decoration:none;text-underline:none'>Asia</span></a>.
    Ocupa gran parte del&nbsp;<a
    href="https://es.wikipedia.org/wiki/Hemisferio_occidental"
    title="Hemisferio occidental"><span style='color:windowtext;text-decoration:
    none;text-underline:none'>hemisferio occidental</span></a>&nbsp;del
    planeta. Se extiende desde el&nbsp;<a
    href="https://es.wikipedia.org/wiki/Oc%C3%A9ano_%C3%81rtico"
    title="Océano Ártico"><span style='color:windowtext;text-decoration:none;
    text-underline:none'>océano Ártico</span></a>&nbsp;por el norte hasta
    las&nbsp;<a href="https://es.wikipedia.org/wiki/Islas_Diego_Ram%C3%ADrez"
    title="Islas Diego Ramírez"><span style='color:windowtext;text-decoration:
    none;text-underline:none'>islas Diego Ramírez</span></a>&nbsp;por el sur,
    en la confluencia de los&nbsp;<a
    href="https://es.wikipedia.org/wiki/Oc%C3%A9anos" title=Océanos><span
    style='color:windowtext;text-decoration:none;text-underline:none'>océanos</span></a>&nbsp;<a
    href="https://es.wikipedia.org/wiki/Oc%C3%A9ano_Atl%C3%A1ntico"
    title="Océano Atlántico"><span style='color:windowtext;text-decoration:
    none;text-underline:none'>Atlántico</span></a>&nbsp;y&nbsp;<a
    href="https://es.wikipedia.org/wiki/Oc%C3%A9ano_Pac%C3%ADfico"
    title="Océano Pacífico"><span style='color:windowtext;text-decoration:none;
    text-underline:none'>Pacífico</span></a>, los cuales a su vez delimitan al
    continente por el este y el oeste, respectivamente.<o:p></o:p></span></p>
    </div>
    <![if !mso]></td>
